DIAttribute.value:
$L_Filas_Destino  = $P_Filas_Destino; 
$L_Filas_Origen  = $P_Filas_Origen ;
$L_Id_Carga  = $P_Id_Carga ;
$L_Nivel = $P_Nivel ;

$L_IdCalendario = sql('DS_CONTROL_V2','SELECT MAX(IDCALENDARIO) FROM CT_TB_CARGAS_ETL_AUD  WHERE IDCARGA = [$L_Id_Carga]');

IF ($L_Nivel = 1)
begin
	sql('DS_CONTROL_V2','UPDATE CT_TB_CARGAS_ETL_AUD SET  QR_ORI_NIVEL_1 = [$L_Filas_Origen ], QR_DES_NIVEL_1=[$L_Filas_Destino] WHERE IDCARGA = [$L_Id_Carga] and IDCALENDARIO = [$L_IdCalendario]');
	

end
else
begin
	IF ($L_Nivel = 2)
	begin
		sql('DS_CONTROL_V2','UPDATE CT_TB_CARGAS_ETL_AUD SET QR_ORI_NIVEL_2 = [$L_Filas_Origen ], QR_DES_NIVEL_2=[$L_Filas_Destino] WHERE IDCARGA = [$L_Id_Carga] and IDCALENDARIO = [$L_IdCalendario]');
	end
	else
	begin
		IF ($L_Nivel = 3)
		begin
			sql('DS_CONTROL_V2','UPDATE CT_TB_CARGAS_ETL_AUD SET  QR_ORI_NIVEL_3 = [$L_Filas_Origen ], QR_DES_NIVEL_3=[$L_Filas_Destino] WHERE IDCARGA = [$L_Id_Carga] and IDCALENDARIO = [$L_IdCalendario]');
		end
		
		
	end
		
end

Return 0;

#Se agrega  ";" para hacer correctamente el split de word_ext
#Se quita el inicio de la cadena X002
$inputString = replace_substr($inputString || ';','X002:','');
#Calcula la posicion del primer ";" 
$intPos = index($inputString,$searchChar,1); 

#PRINT('INICIA FUNCION');
#PRINT ($inputString);

$intIdPaquete = -1; #Inicio de la variable por si no encuentra un id

#Lleva el control de los grupos
$intGrupo = 0; 
while ($intPos > 0) 
    begin 

			$intGrupo = $intGrupo + 1; #Aumenta los saltos de los grupos
			#PRINT('GRUPO #: ' || $intGrupo);
			$intPos = index($inputString,$searchChar,$intPos + 1);
			
			#EXTRAE GRUPOS 
			$v_strExtrac= word_ext( $inputString,$intGrupo,';');

			#print($v_strExtrac);
		#NOTA IMPORTANTE: En las expresiones regulares de SCRPTING DE DS
		# los caracteres y otros "][" tiene funciones especiales por eso se antepone "\"
        if(match_regex($v_strExtrac,'\[0-9\]+\:\[0-9\]+\:\[0-9\]+\:\[0-9\]+\:\-\[0-9\]+',null) = 1) 
            begin
		    #    print('MATCHED: ' || $v_strExtrac);
			    #Se extrae el id del paquete de la posicion [2] separados por ":"
			    $intIdPaquete = word_ext( $v_strExtrac,2,':');
				#Se coloca a cero la poscion para salir del WHILE
				$intPos = 0;

			end
        #else
		#    begin
				#print('no MATCH');
		#	end
        
    end 

return $intIdPaquete;

#INICIALIZACION DE VARIABLES $v_principal = 0; $v_periodica = 0; $v_bonus = 0; $v_operador = 0;
#VALIDACION DE CUENTA PRINCIPAL IF ($p_principaldelta + nvl($p_principalextra,0) <> 0)
BEGIN
$v_principal = 1;
END
#VALIDACION DE CUENTA PERIODICA IF ($p_periodicadelta + nvl($p_periodicaextra,0) <> 0)
BEGIN
$v_periodica = 1;
END
#VALIDACION DE CUENTA BONUS IF ($p_bonusdelta + nvl($p_bonusextra,0) <> 0)
BEGIN
$v_bonus = 1;
END
#VALIDACION DE CUENTA OPERADOR IF ($p_operadordelta + nvl($p_operadorextra,0) <> 0)
BEGIN
$v_operador = 1;
END
$v_combinacion = ($v_principal*8)+($v_periodica*4)+($v_bonus*2)+($v_operador*1);
$v_tipo_cobro = DECODE( $v_combinacion = 0, '03', $v_combinacion = 1, '09', $v_combinacion = 2, '01', $v_combinacion = 3, '10', $v_combinacion = 4, '06', $v_combinacion = 5, '11', $v_combinacion = 6, '05', $v_combinacion = 7, '16', $v_combinacion = 8, '08', $v_combinacion = 9, '12', $v_combinacion = 10, '02', $v_combinacion = 11, '15', $v_combinacion = 12, '07', $v_combinacion = 13, '14', $v_combinacion = 14, '04', $v_combinacion = 15, '13', '00' );
RETURN $v_tipo_cobro;
